import React from 'react';
function Header() {
  return (
    <div className="header">
      <header style= {headerStyle}>
      <h1> To Do List App </h1>
      </header>
    </div>
  )
}

const headerStyle = {
  overflow:"hidden",
  background: '#00FA9A',
  color: 'white',
  textAlign: 'center',
  padding: '10px',
  fontFamily:"consolas"
}

export default Header;
